import './Card.css';
import { Link } from 'react-router-dom';

export default function Card ({min, max, name, img, onClose, id , }) {
    return (
    <Link to={`/ciudad/${id}`} >
      <div className="card">
            <button onClick={onClose} className="close">X</button>
      <div className='city'>
      <h3 >{name}</h3>
      </div>
      <div className='datos'>
      <p>Temperatura Minima : {min} ºC</p>
      <p>Temperatura Maxima {max} ºC</p>

        </div>
      </div>
    </Link>
    );
};









